    <div>
    <p class=MsoNormal style='text-align:justify;line-height:150%'><span
    style='font-size:14.0pt;mso-bidi-font-size:11.0pt;line-height:150%'>En este
    evento tianguis de las 5R principalmente se presenta para concientizar a
    los alumnos y los padres de familia que gusten acompañarnos, la temática
    que se utilizará o el pase para ingresar a la preparatoria será por lo
    menos 1KL de aluminio o más, esto para el apoyo de los alumnos en su venta
    de comida, dulces típicos artesanales, juguetes, ropa, etc...<o:p></o:p></span></p>
    </div>
